var $bm_rt;
var pathToTrace = thisComp.layer('Shape Layer 1')('ADBE Root Vectors Group')(1)('ADBE Vectors Group')(1)('ADBE Vector Shape');
var progress = $bm_div(thisLayer.effect('progress')('ADBE Slider Control-0001'), 100);
var pathTan = pathToTrace.tangentOnPath(progress);
$bm_rt = radiansToDegrees(Math.atan2(pathTan[1], pathTan[0]));

p.x:
var $bm_rt;
var pathLayer = thisComp.layer('Shape Layer 1');
var progress = $bm_div(thisLayer.effect('progress')('ADBE Slider Control-0001'), 100);
var pathToTrace = pathLayer('ADBE Root Vectors Group')(1)('ADBE Vectors Group')(1)('ADBE Vector Shape');
$bm_rt = pathLayer.toComp(pathToTrace.pointOnPath(progress));

v.x:
var $bm_rt;
var offset, end, offset, a, a, invert;
offset = $bm_mod(thisComp.layer('Shape Layer 1').content('Trim In Path').offset, 360);
end = thisComp.layer('Shape Layer 1').content('Trim In Path').end;
if (offset < 0)
    offset = $bm_sum(offset, 360);
a = linear(offset, 0, 360, 0, 100);
a = $bm_sum(a, end) == 100 ? 100 : $bm_mod($bm_sum(a, end), 100);
invert = effect('trace_invert')('ADBE Checkbox Control-0001');
$bm_rt = invert == 1 ? $bm_sub(100, a) : a;
